webpackJsonp([67718465187320],{322:function(e,n){e.exports={data:{markdownRemark:{html:"<h4>por Mario Benedetti</h4>\n<p>Se me ocurre que vas a llegar distinta <br/>\nno exactamente más linda <br/>\nni más fuerte <br/>\nni más dócil <br/>\nni más cauta <br/>\ntan solo que vas a llegar distinta <br/>\ncomo si esta temporada de no verme <br/>\nte hubiera sorprendido a vos también <br/>\nquizá porque sabes <br/>\ncómo te pienso y te enumero <br/></p>\n<p>Después de todo la nostalgia existe <br/>\naunque no lloremos en los andenes fantasmales <br/>\nni sobre las almohadas de candor <br/>\nni bajo el cielo opaco <br/></p>\n<p>Yo nostalgio <br/>\ntu nostalgias <br/>\ny cómo me revienta que él nostalgie <br/></p>\n<p>Tu rostro es la vanguardia <br/>\ntal vez llega primero <br/>\nporque lo pinto en las paredes <br/>\ncon trazos invisibles y seguros <br/></p>\n<p>No olvides que tu rostro <br/>\nme mira como pueblo <br/>\nsonríe y rabia y canta <br/>\ncomo pueblo <br/>\ny eso te da una lumbre <br/>\ninapagable <br/>\nahora no tengo dudas <br/>\nvas a llegar distinta y con señales <br/>\ncon nuevas <br/>\ncon hondura <br/>\ncon franqueza <br/></p>\n<p>Sé que voy a quererte sin preguntas. <br/>\nSé que vas a quererme sin respuestas.</p>",frontmatter:{title:"Bienvenida",date:"December 12, 2017",path:"/bienvenida-mario-benedetti",tags:["poema","mario benedetti","poeta latinoamericano"],excerpt:"Se me ocurre que vas a llegar distinta"}}},pathContext:{prev:null,next:{html:"<h4>a song by Gorillaz | Damon Albarn</h4>\n<p>Where does it come from? <br/>\nWhen everything was outside <br/>\nBusted and blue <br/>\nHow in the universe <br/>\nThrough the lithium <br/>\nBusted and blue <br/>\nI was asked by a computer <br/>\nA shadow on the wall <br/>\nAn image made by Virgil <br/>\nTo rule over us all <br/>\nTo amplify the sirens <br/>\nAnd to find real amends <br/>\nI'm through the echo-chambers <br/>\nTo other worlds away <br/>\nAll my life <br/>\nAll my life <br/>\nBeam a light <br/>\nOn me, I am a satellite <br/>\nAnd I can't get back without you <br/>\nBe my love <br/>\nBe my love <br/>\nBe my love <br/>\nBe my love <br/>\nWhere do they come from? <br/>\nThe wires that connect to us <br/>\nWeightless and fall on your body <br/>\n'Till we're invisible <br/>\nI'm with you throughout it, choose <br/>\nBusted and blue <br/>\nAll my life <br/>\nAll my life <br/>\nBeam a light <br/>\nOn me, I am a satellite <br/>\nAnd I can't get back without you <br/>\nBe my love <br/>\nBe my love <br/>\nBe my love <br/>\nBe my love <br/>\nBusted and blue <br/></p>",id:"/Users/fernandomendoza/Proyectos/my-blog/src/pages/2017-12-11-busted-and-blue/index.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2017-12-12T03:33:49+00:00",path:"/busted-and-blue",title:"Busted and Blue",excerpt:"And I can't get back without you",tags:["gorillaz","damon albarn","busted","blue"]}}}}}});
